var action = {
  toggleFullScreen: function () {
    if (
      (document.fullScreenElement && document.fullScreenElement !== null) ||
      (!document.mozFullScreen && !document.webkitIsFullScreen)
    ) {
      if (document.documentElement.requestFullScreen) {
        document.documentElement.requestFullScreen();
      } else if (document.documentElement.mozRequestFullScreen) {
        document.documentElement.mozRequestFullScreen();
      } else if (document.documentElement.webkitRequestFullScreen) {
        document.documentElement.webkitRequestFullScreen(
          Element.ALLOW_KEYBOARD_INPUT
        );
      }
      d3.select("#svgSubChart").attr("style", "display: none;");
      d3.select(activeCluster.selector + " svg")
        .attr("width", screen.width - 23)
        .attr("height", screen.height - 10);
    } else {
      if (document.cancelFullScreen) {
        document.cancelFullScreen();
      } else if (document.mozCancelFullScreen) {
        document.mozCancelFullScreen();
      } else if (document.webkitCancelFullScreen) {
        document.webkitCancelFullScreen();
      }
      d3.select("#svgSubChart").attr("style", null);
      d3.select(activeCluster.selector + " svg")
        .attr("width", activeCluster.chartWidth)
        .attr("height", activeCluster.chartHeight);
    }
  },
  expandAll: function () {
    if (!isExpand) {
      activeCluster.expand(activeCluster.data);
      isExpand = true;
      $("button.btn-expand i").removeClass("fa-expand");
      $("button.btn-expand i").addClass("fa-compress");
    } else {
      activeCluster.collapse(activeCluster.data);
      isExpand = false;
      $("button.btn-expand i").removeClass("fa-compress");
      $("button.btn-expand i").addClass("fa-expand");
    }
    activeCluster.update(activeCluster.data);
  },
  search: {
    searchItems: function () {
      d3.selectAll(".user-search-box")
        .transition()
        .duration(250)
        .style("width", "350px")
        .style("display", "block");
    },
    closeSearchBox: function () {
      d3.selectAll(".user-search-box")
        .transition()
        .duration(250)
        .style("width", "0px")
        .style("display", "none")
        .each("end", function () {
          action.search.clearResult();
          clear(".search-input");
        });
    },
    clearResult: function () {
      set(".result-list", '<div class="buffer" ></div>');
      set(".user-search-box .result-header", "RESULT");
    },
    reflectResults: function (results) {
      var htmlStringArray = results.map(function (result) {
        var strVar = "";
        strVar += '         <div class="list-item">';
        strVar += '            <div class="image-wrapper">';
        strVar +=
          '              <img class="image" src="' +
          getIcon(result.type, "-all") +
          '"/>';
        strVar += "            </div>";
        strVar += '            <div class="description">';
        strVar += '              <p class="name">' + result.name + "</p>";
        strVar += '              <p class="type">' + result.type + "</p>";
        strVar += "            </div>";
        strVar += '            <div class="buttons">';
        if (result.type == "machine") {
          strVar +=
            "              <a target='_blank' href='/machine/" +
            result.id +
            "'><button class='btn btn-search-box btn-action btn-view-machine'>View</button></a>";
        }

        strVar +=
          "              <button class='btn btn-search-box btn-action btn-locate' onclick='action.search.locate(" +
          result.uniqueIdentifier +
          ")'>Locate </button>";
        strVar += "            </div>";
        strVar += "        </div>";
        return strVar;
      });

      var htmlString = htmlStringArray.join("");
      action.search.clearResult();

      var parentElement = get(".result-list");
      var old = parentElement.innerHTML;
      var newElement = htmlString + old;
      parentElement.innerHTML = newElement;
      set(
        ".user-search-box .result-header",
        "RESULT - " + htmlStringArray.length
      );
    },
    findInTree: function (rootElement, searchText) {
      var result = [];
      // use regex to achieve case insensitive search and avoid string creation using toLowerCase method
      var regexSearchWord = new RegExp(searchText, "i");

      recursivelyFindIn(rootElement, searchText);

      return result;

      function recursivelyFindIn(user) {
        if (
          user.name.match(regexSearchWord) ||
          user.id.match(regexSearchWord)
        ) {
          result.push(user);
        }

        var childUsers = user.children ? user.children : user._children;
        if (childUsers) {
          childUsers.forEach(function (childUser) {
            recursivelyFindIn(childUser, searchText);
          });
        }
      }
    },
    locate: function (id) {
      activeCluster.locate(id);
    },
  },
  tooltip: {
    closeToolTip: function () {
      d3.select(".customTooltip-wrapper")
        .transition()
        .duration(200)
        .style("opacity", "0")
        .style("display", "none");
    },
  },
  back: function () {
    show([".btn-action"]);
    hide([".customTooltip-wrapper", ".btn-action.btn-back", ,]);
    clear(cluster.selector);

    cluster.mode = "full";
    cluster.data = deepClone(cluster.pristinaData);
    drawChart(cluster);
  },
};

var clusterParams = {
  data: null,
  active: true,
};

d3.json(apiURL, function (data) {
  if (data === null) {
    d3.select("body").html("");
    d3.select("body")
      .append("h1")
      .attr("class", "error")
      .text("Some rrror occured during fetching data!");
    return true;
  }
  graphData = data.graph;
  data.graph.forEach(function (data) {
    populateCluster(data);
  });
  drawAllChart((mainClusterIndex = 0));
});

function populateCluster(data) {
  var newCluster = JSON.parse(JSON.stringify(clusterParams));

  newCluster.data = data;
  newCluster.isActive = false;
  clusterArray.push(newCluster);
}

function drawAllChart(mainClusterIndex) {
  clusterArray.forEach(function (cluster, clusterIndex) {
    drawChart(cluster, clusterIndex);
  });
  activeCluster = clusterArray[mainClusterIndex];
  activeCluster.isActive = true;
  activeCluster.selector = "#svgChart";
  drawChart(activeCluster, mainClusterIndex);
}

function drawChart(cluster, clusterIndex) {
  listen();

  cluster.pristinaData = cluster;
  cluster.expand = expand;
  cluster.update = update;
  cluster.collapse = collapse;
  cluster.locate = locate;

  var attrs = {
    EXPAND_SYMBOL: "\uf067",
    COLLAPSE_SYMBOL: "\uf068",
    selector: cluster.isActive ? "#svgChart" : "#svgSubChart",
    width: cluster.isActive
      ? window.innerWidth - 30
      : (window.innerWidth - 65) / 6,
    height: clusterArray.length == 1 ? window.innerHeight - 27 : 700,
    nodeHeight: cluster.isActive ? 50 : 30,
    nodeWidth: cluster.isActive ? 50 : 30,
    rootNodeTopMargin: cluster.isActive ? 20 : 12,
    nodePadding: cluster.isActive ? 5 : 3,
    linkLineSize: cluster.isActive
      ? 100
      : ((window.innerWidth - 65) * 0.35) / 6,
    root: cluster.data,
    index: 0,
    collapseCircleRadius: 7,
    duration: 500,
    minMaxZoomProportions: [0.1, 5],
    collapsibleFontSize: "7px",
    userIcon: "\uf007",
    nodeStroke: "#ccc",
    nodeStrokeWidth: cluster.isActive ? "2px" : "1px",
  };

  if (clusterArray.length == 1) {
    attrs.height = window.innerHeight - 27;
  } else if (cluster.isActive) {
    attrs.height = 700;
  } else {
    attrs.height = attrs.width;
  }

  var dynamic = {};
  dynamic.nodeImageWidth = cluster.isActive
    ? (attrs.nodeHeight * 100) / 140
    : (attrs.nodeHeight * 100) / 140;
  dynamic.nodeImageHeight = attrs.nodeHeight - 2 * attrs.nodePadding;
  dynamic.nodeTextLeftMargin = 0; //attrs.nodePadding * 2 + dynamic.nodeImageWidth;

  dynamic.rootNodeLeftMargin = attrs.width / 2;
  dynamic.nodePositionNameTopMargin =
    attrs.nodePadding + 8 + (dynamic.nodeImageHeight / 4) * 1;
  dynamic.nodeChildCountTopMargin =
    attrs.nodePadding + 14 + (dynamic.nodeImageHeight / 4) * 3;

  var tree = d3.layout
    .tree()
    .nodeSize([attrs.nodeWidth + 40, attrs.nodeHeight]);

  var diagonal = d3.svg.diagonal().projection(function (d) {
    return [d.x + attrs.nodeWidth / 2, d.y + attrs.nodeHeight / 2];
  });

  var zoomBehaviours = d3.behavior
    .zoom()
    .scaleExtent(attrs.minMaxZoomProportions)
    .on("zoom", function () {
      return cluster.isActive ? redraw() : null;
    });

  var svg = (svg = d3
    .select(attrs.selector)
    .append("div")
    .attr("class", function () {
      if (cluster.isActive) return "cluster active card";
      else return "cluster card";
    })
    .attr("id", function () {
      return cluster.isActive
        ? "cluster_main"
        : "cluster_" + (clusterIndex + 1);
    }));

  svg = svg
    .append("svg")
    .attr("width", function () {
      return cluster.isActive ? "100%" : attrs.width;
    })
    .attr("height", attrs.height)
    .call(zoomBehaviours)
    .on("dblclick.zoom", null)
    .append("g")

    .attr("transform", function () {
      return cluster.isActive
        ? "translate(" +
            (attrs.width - attrs.nodeWidth) / 2 +
            "," +
            (attrs.nodeHeight + 5) +
            ")"
        : "translate(" +
            (attrs.width - attrs.nodeWidth) / 2 +
            "," +
            (attrs.height - attrs.nodeHeight - attrs.linkLineSize + 5) / 2 +
            ")";
    });

  if (cluster.isActive) {
    d3.selectAll("#svgSubChart div.cluster").attr("class", "cluster card");
    d3.select("#svgSubChart div#cluster_" + (clusterIndex + 1)).attr(
      "class",
      "cluster card selected"
    );
  }
  //necessary so that zoom knows where to zoom and unzoom from
  zoomBehaviours.translate([
    dynamic.rootNodeLeftMargin,
    attrs.rootNodeTopMargin,
  ]);

  attrs.root.x0 = 0;
  attrs.root.y0 = dynamic.rootNodeLeftMargin;

  // adding unique values to each node recursively
  if (cluster.isActive) {
    var uniq = 1;
    addPropertyRecursive(
      "uniqueIdentifier",
      function (v) {
        return uniq++;
      },
      attrs.root
    );
  }

  // expand(attrs.root);
  if (attrs.root.children) {
    attrs.root.children.forEach(collapse);
  }

  update(attrs.root);

  d3.select(attrs.selector).style("height", attrs.height);

  function update(source, param) {
    if (!source) return true;
    // Compute the new tree layout.
    var nodes = tree.nodes(attrs.root).reverse();
    var links = tree.links(nodes);

    // var targetId = [];
    // var commmonTarget = [];
    // links.forEach(function (link, index) {
    //   if (targetId.includes(link.target.id)) {
    //     commmonTarget.push(index);
    //   } else {
    //     targetId.push(link.target.id);
    //   }
    // });
    // removedNode = [];
    // commmonTarget.forEach(function (nodeIndex) {
    //   removedNode.push(nodes[nodeIndex]);
    //   nodes.splice(nodeIndex, 1);
    // });
    // Normalize for fixed-depth.
    nodes.forEach(function (d) {
      d.y = d.depth * attrs.linkLineSize;
    });

    // Update the nodes…
    var node = svg.selectAll("g.node").data(nodes, function (d) {
      return d.id || (d.id = ++attrs.index);
    });

    // Enter any new nodes at the parent's previous position.
    var nodeEnter = node
      .enter()
      .append("g")
      .attr("class", "node")
      .attr("transform", function (d) {
        return "translate(" + source.x0 + "," + source.y0 + ")";
      });

    var nodeGroup = nodeEnter.append("g").attr("class", "node-group");

    nodeGroup
      .append("rect")
      .attr("width", attrs.nodeWidth)
      .attr("height", attrs.nodeHeight)
      .attr("data-node-group-id", function (d) {
        return d.uniqueIdentifier;
      })
      .attr("class", function (d) {
        var res = "";
        if (d.is_unknown) res += "nodeRepresentsCurrentItem ";
        res +=
          d._children || d.children
            ? "nodeHasChildren"
            : "nodeDoesNotHaveChildren";
        return res;
      });

    var collapsiblesWrapper = nodeEnter
      .append("g")
      .attr("data-id", function (v) {
        return v.uniqueIdentifier;
      });

    if (cluster.isActive) {
      //hide collapse rect when node does not have children
      var collapsibles = collapsiblesWrapper
        .append("circle")
        .attr("class", "node-collapse")
        .attr("cx", attrs.nodeWidth - attrs.collapseCircleRadius)
        .attr("cy", attrs.nodeHeight - 7)
        .attr("", function (d) {
          if (d._children) {
            d.collapseText = attrs.EXPAND_SYMBOL;
          } else if (d.children) {
            d.collapseText = attrs.COLLAPSE_SYMBOL;
          }
        });

      collapsiblesWrapper
        .append("rect")
        .attr("class", "node-collapse-right-rect")
        .attr("height", attrs.collapseCircleRadius)
        .attr("fill", "black")
        .attr("x", attrs.nodeWidth - attrs.collapseCircleRadius)
        .attr("y", attrs.nodeHeight - 7)
        .attr("width", function (d) {
          if (d.children || d._children) return attrs.collapseCircleRadius;
          return 0;
        });
      collapsibles
        .attr("r", function (d) {
          if (d.children || d._children) return attrs.collapseCircleRadius;
          return 0;
        })
        .attr("height", attrs.collapseCircleRadius);

      nodeGroup
        .append("text")
        .attr("x", dynamic.nodeTextLeftMargin + 4)
        .attr("y", function () {
          return cluster.isActive
            ? dynamic.nodeChildCountTopMargin - 2
            : dynamic.nodeChildCountTopMargin;
        })
        .attr("class", "children-count")
        .attr("text-anchor", "left")

        .text(function (d) {
          if (d.children) return d.children.length;
          if (d._children) return d._children.length;
          return;
        });

      collapsiblesWrapper
        .append("text")
        .attr("class", "text-collapse")
        .attr("x", attrs.nodeWidth - attrs.collapseCircleRadius)
        .attr("y", attrs.nodeHeight - 3)
        .attr("width", attrs.collapseCircleRadius)
        .attr("height", attrs.collapseCircleRadius)
        .style("font-size", attrs.collapsibleFontSize)
        .attr("text-anchor", "middle")
        .style("font-family", "FontAwesome")
        .text(function (d) {
          return d.collapseText;
        });
    }

    nodeGroup
      .append("text")
      .attr("x", dynamic.nodeTextLeftMargin)
      .attr("y", -5)
      .attr("class", "item-name")
      .attr("text-anchor", "left")
      .text(function (d) {
        return d.name.trim();
      })
      .call(shiftText, attrs.nodeWidth);
    //   .call(wrap, attrs.nodeWidth);

    nodeGroup
      .append("defs")
      .append("svg:clipPath")
      .attr("id", "clip")
      .append("svg:rect")
      .attr("id", "clip-rect")
      .attr("rx", 3)
      .attr("x", attrs.nodePadding + 2)
      .attr("y", attrs.nodePadding)
      .attr("width", dynamic.nodeImageWidth)
      .attr("fill", "none")
      .attr("height", dynamic.nodeImageHeight - 4);

    nodeGroup
      .append("svg:image")
      .attr("y", 2 + attrs.nodePadding)
      .attr("x", attrs.nodePadding + 2)
      .attr("preserveAspectRatio", "none")
      .attr("width", dynamic.nodeImageWidth)
      .attr("height", dynamic.nodeImageWidth)
      .attr("clip-path", "url(#clip)")
      .attr("xlink:href", function (v) {
        if (v.type == "machine") {
          var type = v.additional_data.os
            ? "-" + v.additional_data.os.toLowerCase()
            : "";
          type += v._children && v._children.length ? "-expand" : "";
          if (v.type == "machine" && !v.additional_data.has_access)
            type = "-noaccess";
          if (v.is_unknown) type += "-unknown";
          return getIcon(v.type, type);
        } else if (v.type == "application") {
          var type = "-all";
          return getIcon(v.type, type);
        } else if (v.type == "appstack") {
          var type = "-all";
          return getIcon(v.type, type);
        }
      });

    // Transition nodes to their new position.
    var nodeUpdate = node
      .transition()
      .duration(attrs.duration)
      .attr("transform", function (d) {
        return "translate(" + d.x + "," + d.y + ")";
      });

    //todo replace with attrs object
    nodeUpdate
      .select("rect")
      .attr("width", attrs.nodeWidth)
      .attr("height", attrs.nodeHeight)
      .attr("rx", 3)
      .attr("stroke", function (d) {
        if (param && d.uniqueIdentifier == param.locate) {
          return "#a1ceed";
        }
        return attrs.nodeStroke;
      })
      .attr("stroke-width", function (d) {
        if (param && d.uniqueIdentifier == param.locate) {
          return 6;
        }
        return attrs.nodeStrokeWidth;
      });

    // Transition exiting nodes to the parent's new position.
    var nodeExit = node
      .exit()
      .transition()
      .duration(attrs.duration)
      .attr("transform", function (d) {
        return "translate(" + source.x + "," + source.y + ")";
      })
      .remove();

    nodeExit
      .select("rect")
      .attr("width", attrs.nodeWidth)
      .attr("height", attrs.nodeHeight);

    // Update the links…
    var link = svg
      .selectAll("path.link, path.link-strong")
      .data(links, function (d) {
        return d.target.id;
      });

    // Enter any new links at the parent's previous position.
    link
      .enter()
      .insert("path", "g")
      .attr("class", function () {
        return cluster.isActive ? "link-strong" : "link";
      })
      .attr("x", attrs.nodeWidth / 2)
      .attr("y", attrs.nodeHeight / 2)
      .attr("d", function () {
        var o = {
          x: source.x0,
          y: source.y0,
        };

        return diagonal({
          source: o,
          target: o,
        });
      });

    // if (removedNode.length) {
    //   var link = svg
    //     .selectAll("path.link, path.link-strong")
    //     .data(links, function (d) {
    //       return d.target.id;
    //     });
    //   console.log(123);
    //   customLink = links[0];
    //   var s = {
    //     x: customLink.source.x,
    //     y: customLink.source.y,
    //   };
    //   var t = {
    //     x: customLink.target.x,
    //     y: customLink.target.y,
    //   };
    //   path = d3.select("svg g");
    //   path
    //     .append("path")
    //     .attr("class", function () {
    //       return cluster.isActive ? "link-strong" : "link";
    //     })
    //     .attr("x", attrs.nodeWidth / 2)
    //     .attr("y", attrs.nodeHeight / 2)
    //     .attr("d", "M 200 45C 175 45,175 45,150 45");
    //   commmonTarget.forEach(function (common, index) {
    //     // link[0].splice(common, 1);
    //     link[0][common] = link[0][0];
    //   });
    // }

    // Transition links to their new position.
    link.transition().duration(attrs.duration).attr("d", diagonal);

    // Transition exiting nodes to the parent's new position.

    link
      .exit()
      .transition()
      .duration(attrs.duration)
      .attr("d", function (d) {
        var o = {
          x: source.x,
          y: source.y,
        };
        return diagonal({
          source: o,
          target: o,
        });
      })
      .remove();

    if (!$("div.customTooltip-wrapper").length) {
      d3.select("body").append("div").attr("class", "customTooltip-wrapper");
    }

    if (cluster.isActive) {
      // Stash the old positions for transition.
      nodes.forEach(function (d) {
        d.x0 = d.x;
        d.y0 = d.y;
      });

      if (param && param.locate) {
        var x;
        var y;

        nodes.forEach(function (d) {
          if (d.uniqueIdentifier == param.locate) {
            x = d.x;
            y = d.y;
          }
        });

        // normalize for width/height
        var new_x = -x + window.innerWidth / 2;
        var new_y = -y + window.innerHeight / 2;

        // move the main container g
        svg.attr("transform", "translate(" + new_x + "," + new_y + ")");
        zoomBehaviours.translate([new_x, new_y]);
        zoomBehaviours.scale(1);
      }

      if (param && param.centerMySelf) {
        var x;
        var y;

        nodes.forEach(function (d) {
          if (d.is_unknown) {
            x = d.x;
            y = d.y;
          }
        });

        // normalize for width/height
        var new_x = -x + window.innerWidth / 2;
        var new_y = -y + window.innerHeight / 2;

        // move the main container g
        svg.attr("transform", "translate(" + new_x + "," + new_y + ")");
        zoomBehaviours.translate([new_x, new_y]);
        zoomBehaviours.scale(1);
      }

      collapsiblesWrapper.on("click", nodeClick);
      d3.selectAll("#svgChart .node").on("dblclick", nodeClick);
      // d3.selectAll("#svgChart .node").on("click", tooltipHoverHandler);
      d3.selectAll("#svgChart .node").on("mouseover", tooltipHoverHandler);

      d3.selectAll("#svgChart .node").on("mouseout", function () {
        action.tooltip.closeToolTip();
      });
    }
    d3.selectAll("#svgSubChart .cluster").on("click", function () {
      id = this.getAttribute("id").split("_")[1];
      id = parseInt(id);
      if (id <= clusterArray.length) {
        switchMainCluster(id - 1);
      }
    });
  }

  function expand(d) {
    if (d.children) {
      d.children.forEach(expand);
    }

    if (d._children) {
      d.children = d._children;
      d.children.forEach(expand);
      d._children = null;
    }

    if (d.children) {
      // if node has children and it's expanded, then  display -
      setToggleSymbol(d, attrs.COLLAPSE_SYMBOL);
    }
  }

  function collapse(d) {
    if (d._children) {
      d._children.forEach(collapse);
    }
    if (d.children) {
      d._children = d.children;
      d._children.forEach(collapse);
      d.children = null;
    }

    if (d._children) {
      // if node has children and it's collapsed, then  display +
      setToggleSymbol(d, attrs.EXPAND_SYMBOL);
    }
  }

  // for zoom
  function redraw() {
    svg.attr(
      "transform",
      "translate(" + d3.event.translate + ")" + " scale(" + d3.event.scale + ")"
    );
  }

  function nodeClick(d) {
    d3.select(this)
      .select(".text-collapse")
      .text(function (dv) {
        if (dv.collapseText == attrs.EXPAND_SYMBOL) {
          dv.collapseText = attrs.COLLAPSE_SYMBOL;
        } else {
          if (dv.children) {
            dv.collapseText = attrs.EXPAND_SYMBOL;
          }
        }
        return dv.collapseText;
      });

    if (d.children) {
      d._children = d.children;
      d.children = null;
    } else {
      d.children = d._children;
      d._children = null;
    }
    update(d);
  }

  /*################  TOOLTIP FUNCTIONS  #############################*/

  function getTagsFromCommaSeparatedStrings(tags) {
    return tags
      .split(",")
      .map(function (v) {
        return '<li><div class="tag">' + v + "</div></li>  ";
      })
      .join("");
  }

  function tooltipContent(item) {
    var strVar = "";

    strVar += '  <div class="customTooltip">';
    strVar +=
      '<div class="tooltip close-button-wrapper"><i onclick="action.tooltip.closeToolTip()" class="fa fa-times" aria-hidden="true"></i></div>';
    strVar += '    <div class="tooltip-desc">';
    if (item.type == "machine") {
      strVar +=
        '      <a class="name" href="/machine/' +
        item.id +
        '" target="_blank"> ' +
        item.name +
        "</a>";
    }
    strVar += '      <p class="title type">' + item.name + "</p>";
    strVar += '      <h4 class="tags-wrapper"><span class="title">Machine List';
    strVar +=
      '        </span>           <ul class="tags">' +
      getTagsFromCommaSeparatedStrings(
        item.additional_data.machines.join(",")
      ) +
      "</ul>         </h4> </div>";
    strVar += '    <div class="bottom-tooltip-hr"></div>';
    strVar += "  </div>";
    strVar += "";

    return strVar;
  }

  function tooltipHoverHandler(d) {
    var content = tooltipContent(d);
    var tooltip = d3.select(".customTooltip-wrapper");
    tooltip.html(content);

    tooltip
      .transition()
      .duration(200)
      .style("opacity", "1")
      .style("display", "block");

    var y = d3.event.pageY;
    var x = d3.event.pageX + 20;

    tooltip.style("top", y + "px").style("left", x + "px");
  }

  function tooltipOutHandler() {
    tooltip
      .transition()
      .duration(200)
      .style("opacity", "0")
      .style("display", "none");
    d3.select(this).attr("stroke-width", 5);
  }

  function shiftText(text, rectWidth) {
    text[0].forEach(function (nameElem) {
      if (nameElem != null) {
        var textWidth = nameElem.getBoundingClientRect().width;
        var x = 0;
        if (rectWidth < textWidth) {
          x = (rectWidth - textWidth) / 2;
        } else if (rectWidth > textWidth) {
          x = (rectWidth - textWidth) / 2;
        }
        d3.select(nameElem).attr("x", x);
      }
    });
  }

  function wrap(text, width) {
    text.each(function () {
      var text = d3.select(this),
        words = text.text().split(/\s+/).reverse(),
        word,
        line = [],
        lineNumber = 0,
        lineHeight = 1.1, // ems
        x = text.attr("x"),
        y = text.attr("y"),
        dy = 0, //parseFloat(text.attr("dy")),
        tspan = text
          .text(null)
          .append("tspan")
          .attr("x", x)
          .attr("y", y)
          .attr("dy", dy + "em");
      while ((word = words.pop())) {
        line.push(word);
        tspan.text(line.join(" "));
        if (tspan.node().getComputedTextLength() > width) {
          line.pop();
          tspan.text(line.join(" "));
          line = [word];
          tspan = text
            .append("tspan")
            .attr("x", x)
            .attr("y", y)
            .attr("dy", ++lineNumber * lineHeight + dy + "em")
            .text(word);
        }
      }
    });
  }

  function addPropertyRecursive(propertyName, propertyValueFunction, element) {
    if (element[propertyName]) {
      element[propertyName] =
        element[propertyName] + " " + propertyValueFunction(element);
    } else {
      element[propertyName] = propertyValueFunction(element);
    }
    if (element.children) {
      element.children.forEach(function (v) {
        addPropertyRecursive(propertyName, propertyValueFunction, v);
      });
    }
    if (element._children) {
      element._children.forEach(function (v) {
        addPropertyRecursive(propertyName, propertyValueFunction, v);
      });
    }
  }

  function getItemsCount(node) {
    var count = 1;
    countChilds(node);
    return count;

    function countChilds(node) {
      var childs = node.children ? node.children : node._children;
      if (childs) {
        childs.forEach(function (v) {
          count++;
          countChilds(v);
        });
      }
    }
  }

  function listen() {
    var input = get(".user-search-box .search-input");
    if (input) {
      input.addEventListener("input", function () {
        var value = input.value ? input.value.trim() : "";
        if (value.length < 3) {
          action.search.clearResult();
        } else {
          var searchResult = action.search.findInTree(
            activeCluster.data,
            value
          );
          action.search.reflectResults(searchResult);
        }
      });
    }
  }

  function switchMainCluster(mainClusterIndex) {
    if (mainClusterIndex < 0 && mainClusterIndex >= clusterArray.length) {
      return true;
    }
    clusterArray.forEach(function (cluster, clusterIndex) {
      if (clusterIndex != mainClusterIndex) {
        cluster.isActive = false;
      } else {
        cluster.isActive = true;
        activeCluster = cluster;
      }
    });

    d3.select("#svgChart").html("");
    clusterArray.forEach(function (cluster, clusterIndex) {
      if (clusterIndex == mainClusterIndex) {
        drawChart(cluster, clusterIndex);
      }
    });
  }

  function setToggleSymbol(d, symbol) {
    d.collapseText = symbol;
    d3.select("*[data-id='" + d.uniqueIdentifier + "']")
      .select("text")
      .text(symbol);
  }

  function findmySelf(d) {
    if (d.is_unknown) {
      expandParents(d);
    } else if (d._children) {
      d._children.forEach(function (ch) {
        ch.parent = d;
        findmySelf(ch);
      });
    } else if (d.children) {
      d.children.forEach(function (ch) {
        ch.parent = d;
        findmySelf(ch);
      });
    }
  }

  function locateRecursive(d, id) {
    if (d.uniqueIdentifier == id) {
      expandParents(d);
    } else if (d._children) {
      d._children.forEach(function (ch) {
        ch.parent = d;
        locateRecursive(ch, id);
      });
    } else if (d.children) {
      d.children.forEach(function (ch) {
        ch.parent = d;
        locateRecursive(ch, id);
      });
    }
  }

  /* expand current nodes collapsed parents */
  function expandParents(d) {
    while (d.parent) {
      d = d.parent;
      if (!d.children) {
        d.children = d._children;
        d._children = null;
        setToggleSymbol(d, attrs.COLLAPSE_SYMBOL);
      }
    }
  }

  function locate(id) {
    /* collapse all and expand logged user nodes */
    if (!attrs.root.children) {
      if (!attrs.root.uniqueIdentifier == id) {
        attrs.root.children = attrs.root._children;
      }
    }
    if (attrs.root.children) {
      attrs.root.children.forEach(collapse);
      attrs.root.children.forEach(function (ch) {
        locateRecursive(ch, id);
      });
    }

    update(attrs.root, { locate: id });
    action.search.closeSearchBox();
  }

  function showCurrentItem() {
    /* collapse all and expand logged user nodes */
    if (!attrs.root.children) {
      if (!attrs.root.is_unknown) {
        attrs.root.children = attrs.root._children;
      }
    }
    if (attrs.root.children) {
      attrs.root.children.forEach(collapse);
      attrs.root.children.forEach(findmySelf);
    }

    update(attrs.root, { centerMySelf: true });
  }
}

function deepClone(item) {
  return JSON.parse(JSON.stringify(item));
}

function show(selectors) {
  display(selectors, "initial");
}

function hide(selectors) {
  display(selectors, "none");
}

function display(selectors, displayProp) {
  selectors.forEach(function (selector) {
    var elements = getAll(selector);
    elements.forEach(function (element) {
      element.style.display = displayProp;
    });
  });
}

function set(selector, value) {
  var elements = getAll(selector);
  elements.forEach(function (element) {
    element.innerHTML = value;
    element.value = value;
  });
}

function clear(selector) {
  set(selector, "");
}

function get(selector) {
  return document.querySelector(selector);
}

function getAll(selector) {
  return document.querySelectorAll(selector);
}

function getPath(s, d) {
  path = `M ${s.y} ${s.x}
      C ${(s.y + d.y) / 2} ${s.x},
        ${(s.y + d.y) / 2} ${d.x},
        ${d.y} ${d.x}`;

  return path;
}

function getIcon(type, iconType) {
  if (svgIcons[type + iconType]) {
    return svgIcons[type + iconType];
  } else {
    if (iconType.indexOf("expand") == -1) return svgIcons[type];
    else return svgIcons[type + "-expand"];
  }
}

window.onresize = function (event) {
  if (
    (document.fullScreenElement && document.fullScreenElement !== null) ||
    (!document.mozFullScreen && !document.webkitIsFullScreen)
  ) {
    d3.select("#svgChart").html("");
    d3.select("#svgSubChart").html("");
    activeClusterIndex = clusterArray.indexOf(activeCluster);
    clusterArray = [];
    graphData.forEach(function (data, clusterIndex) {
      populateCluster(data);
    });
    drawAllChart(activeClusterIndex);
  }
};
